import Vue from 'vue';
import VueRouter from 'vue-router';
import HomePage from '../components/Home.vue';
import DatasetCategory from '../components/DatabaseCategory.vue';

Vue.use(VueRouter);

const routes = [
  {
    path: '/',
    name: 'HomePage',
    component: HomePage
  },
  {
    path: '/:category',
    name: 'DatasetCategory',
    component: DatasetCategory
  }
];

const router = new VueRouter({
  routes
});

export default router;
